import { useState } from 'react';
import {
    Link
} from "react-router-dom";

import s from './Header.module.css';

import HeaderModal from './HeaderModal';



const HeaderMobile = () => {

    return (
        <>
            <div className={s.logo}>
                <p>LOGO</p>
            </div>

        </>
    );
}

export default HeaderMobile;
